B.Mu=new A.I(7,{id:3,question:"What is a wake lock?",answer:"Android device if kept idle for a certain period, will first dim, then turn off the screen & ultimately turn off the CPU. Certain applications like games, movies app require to be awake so use WakeLock to keep the device Awake. \n\n`getWindow().addFlags(WindowManager.LayoutParams.FLAG_KEEP_SCREEN_ON);`\n\n If you need to keep the CPU on, you use PowerManager using getSystemService() and get WakeLock instance. acquire() and release() to get or remove lock; [Requires WakeLock permission]",category:"Android",topic:"Basics",level:1,uploader:"Rohan Patil"},B.i,t.M)
B.LZ=new A.I(7,{id:4,question:"What is context? What\u2019s application context?",answer:"\nIt is the context of the current/active state of the application. It helps access resources, interact with different components throughout the application. For ex- sharedprefs getDefaultSharedPref(this)\n\nApplication Context is tied to the Lifecycle of an Application. Mainly it is an instance that is a singleton and can be accessed via ****getApplicationContext()***\n\n##### Application context used for:\n    \n-   Load Resource Values\n-   Start a Service\n-   Bind to a Service OR getSystemService(applicationContext)\n-   Send a Broadcast\n-   Register BroadcastReceiver\n#####  Activity context used for: \n-   Layout Inflation\n-   Start an Activity\n-   Show a Dialog",category:"Android",topic:"Basics",level:0,uploader:"Admin"},B.i,t.M)
B.LW=new A.I(7,{id:5,question:"What is compileSDK, targetSDK, minSDK versions?",answer:"\n- The `compileSdkVersion` is the version of the API the app is compiled against. This means you can use Android API features upto that version of the API . If you try and use API 16 features but set compileSdkVersion to 15, you will get a compilation error. If you set compileSdkVersionto 16 you can still run the app on a API 15 devices.\n-  The `targetSdkVersion` has nothing to do with how your app is compiled or what APIs you can use. The `targetSdkVersion` is supposed to indicate that you have tested your app on (presumably up to and including) the version you specify. This is more like a certification or sign off you are giving the Android OS as a hint to how it should handle your app in terms of OS features.\n-  `minSdkVersion` means the lowest device Api level app can run on.",category:"Android",topic:"Basics",level:0,uploader:"Admin"},B.i,t.M)
B.LX=new A.I(7,{id:6,question:"What is an Intent?",answer:"An `intent` is an abstract description of an operation to be performed. It can be used with startActivity to launch an Activity, broadcastIntent to send it to any interested BroadcastReceiver components, and Context.startService(Intent) or Context.bindService(Intent, ServiceConnection, int) to communicate with a background Service.\n\n#### Intent Structure\nThe primary pieces of information in an intent are:\n\n- ***action*** - The general action to be performed, such as ACTION_VIEW, ACTION_EDIT, ACTION_MAIN, etc.\n\n- **data** -- The data to operate on, such as a person record in the contacts database, expressed as a Uri.",category:"Android",topic:"Intent",level:0,uploader:"Admin"},B.i,t.M)
B.My=new A.I(7,{id:7,question:"What are types of Intent?",answer:" **Implicit**- We do not name a specific component, but instead declare a general action to perform, which allows a component from another app to handle it. \n\n **Explicit**- specify which application will satisfy the intent, by supplying either the target app's package name (google maps directions to a place) or a fully-qualified component class name.",category:"Android",topic:"Intent",level:0,uploader:"Admin"},B.i,t.M)
B.Nb=new A.I(7,{id:8,question:"What is Pending Intent?",answer:"`Pending Intent` is an intent which you want to trigger at some time in future, even when your application is not alive. This intent can be used by other application which allows it to execute that intent with the same permissions as of our application. It is a reference to a token maintained by the system. Application A can pass a PendingIntent to application B in order to allow application B to execute predefined actions on behalf of application A; regardless of whether application A is still alive.",category:"Android",topic:"Intent",level:1,uploader:"Admin"},B.i,t.M)
B.MR=new A.I(7,{id:9,question:"What are Baseline Profiles?",answer:"Baseline Profiles are a list of classes and methods that are ahead of time compiled and installed with your app. This means that your code does not need to be interpreted using the just-in-time (JIT) compiler when the app is used. This translates into startup time improvements, reduced jank, and overall improved runtime performance for end users.\nIt is a way for the app to provide what is important to the app at run time which can be used for startup, etc. because we are now telling what to optimize ahead of time. \n- Rules for Ahead of Time Compilation \n- Improve Performance \n- Ship with app",category:"Android",topic:"Tools & Concepts",level:2,uploader:"Martin741"},B.i,t.M)
B.Mx=new A.I(7,{id:10,question:"What do know about RxJava?",answer:"\nRxJava is **a JVM library that uses observable sequences to perform asynchronous and event-based programming**. Its primary building blocks are triple O's, which stand for Operator, Observer, and Observables.\n\nEverything in terms of Stream of Data. `Observable` - Can be observed for any changes. For eg. `button.clicks().subscribe{ }` `Observer` - Observes/subscribes the observable onSubscribed() - on first time you subscribed\n\n```\nonNext() - we will get new data here each time\nonError() - on error\nonComplete() - on finish\n```\n\n`Operator` - To manipulate stream of data \n\nFor eg- `button.clicks().throttleFirst(1500, Time.IN_MILLIS).subscribe{ }` It will ignore for 1500 ms once clicked",category:"Android",topic:"Tools & Concepts",level:1,uploader:"Admin"},B.i,t.M)
B.MA=new A.I(7,{id:11,question:"What is Proguard & R8?",answer:"`ProGuard` is an open source command-line tool that shrinks, optimizes and obfuscates Java code.\n`R8` uses proguard rules to optimize. It will remove unused code from your app, the libraries you are using. \n- Remove unused resources, unused if..else statement & shrink code. \n- obfuscate code, rename your variables, functions to short unreadable names for release so it can't be reverse engineering. \n- minifyEnabled true, shrinkResources true, proguard files <rules file> \n- To keep/ignore some imp classes like data class : -keep class com.hello.world.data_models.*;  \n- In app/build/outputs/mapping/release/mapping.txt This is a mapping file android uses in order to send error messages to map obfuscate names - original name",category:"Android",topic:"Tools & Concepts",level:1,uploader:"Martin741"},B.i,t.M)
B.N9=new A.I(7,{id:1674208840927,question:"What are fragments? Describe its lifecycle.",answer:"    \n### Definition\n___\n\n**A Fragment represents a reusable portion of your app's UI**. A fragment defines and manages its own layout, has its own lifecycle, and can handle its own input events. Fragments cannot live on their own--they must be hosted by an activity or another fragment.\n\n    \n\n### Lifecyle\n___\n\n![fragment lifecyle](https://i.postimg.cc/kGhLFwvg/fragment-view-lifecycle.png)\n\n> **Tip:** This question is very common & will most likely be asked in an Android interview.\n\n    ",category:"Android",topic:"Fragments",level:1,uploader:"Kartik Sharma"},B.i,t.M)
B.ME=new A.I(7,{id:1674209998332,question:"How fragment communicate with activity & other fragments?\n",answer:"    \n### Communicating Fragment with Activity\n\n- To allow a Fragment to communicate up to its Activity, **you can define an interface in the Fragment class and implement it within the Activity**. The Fragment captures the interface implementation during its `` onAttach() `` lifecycle method and can then call the Interface methods to communicate with the Activity.\n\n\n\n### Communicating Fragment with Activity & other Fragments\n\n- We can create a **Shared ViewModel**  with its LiveData variables for the Fragment to share its state with the Activity.\n\n\n\n    ",category:"Android",topic:"Fragments",level:0,uploader:"Kartik Sharma"},B.i,t.M)
B.MX=new A.I(7,{id:1674210285117,question:"Difference between adding and replace fragment in backstack?",answer:"\xb7 **replace** removes the existing fragment and adds a new fragment. This means when you press the back button the fragment that got replaced will be created with its onCreateView being invoked.\n\n\xb7 **add** retains the existing fragments and adds a new fragment which means the existing fragment will be active and they won't be in a \u2018paused\u2019 state hence when a back button is pressed onCreateView is not called for the existing fragment(the fragment which was there before new fragment was added).\n\n    ",category:"Android",topic:"Fragments",level:0,uploader:"Kartik Sharma"},B.i,t.M)
B.ND=new A.I(8,{id:1674210831972,question:"Suppose an activity has 2 fragments (Fragment1 & Fragment2) and we use FragmentManager to replace with addToBackstack each fragment to a layout in activity\ni) Lifecycle when Fragment1 is opened (using replace)?\nii) Lifecycle when Fragment2 is opened from Fragment1 (using replace)?\niii) Lifecycle when pop Fragment2?\niv) Lifecycle when pop Fragment1?",answer:"### i) Lifecycle: Fragment1 is opened (using replace):\n\n\n![answer part 1](https://miro.medium.com/max/468/1*QfFTEA2KKDCSJ4JSvONruA.webp)\n\n___\n\n### ii) Lifecycle: Fragment2 is opened from Fragment1 (using replace):\n\n![answer part 2](https://miro.medium.com/max/966/1*eG_fYFMyhlWEq4YlVSJfgw.webp)\n\n\n___\n\n### iii) Lifecycle: pop Fragment2:\n\n![answer part 3](https://miro.medium.com/max/966/1*VWAECT2VBxzVDGOQabGXIw.webp)\n\n\n___\n\n\n### iv) Lifecycle: pop Fragment1:\n\n![answer part 4](https://miro.medium.com/max/468/1*U7xTRRDcaXYMbE_gK8aRSQ.webp)\n\n\n    ",category:"Android",topic:"Fragments",level:1,uploader:"Zayed Noor",sociallink:"https://medium.com/@zayed007"},B.pG,t.M)
B.MI=new A.I(7,{id:1674211667178,question:"What are Coroutines?",answer:" A **Coroutine** can be thought of as a worker that performs some long-running/memory-intensive operations asynchronously. The asynchronous nature of a coroutine ensures that any long-running/memory-intensive operations do not block the main thread of execution. In essence, it takes a block of code and runs it on a particular thread.\n\n\n    ",category:"Android",topic:"Coroutines",level:0,uploader:"Kartik Sharma"},B.i,t.M)
B.Md=new A.I(7,{id:1674211758467,question:"How are Coroutines different from Threads?",answer:"**Coroutines may be thought of as lightweight threads**. They are called so because multiple coroutines can be scheduled to be executed on the same thread. So, the creation of 100,000 threads results in the creation of 100,000 threads. Whereas, the creation of 100,000 coroutines doesn\u2019t necessarily mean that 100,000 threads get created. Since the resources of a single thread are shared by multiple coroutines, they are much lighter when compared to creating raw threads.",category:"Android",topic:"Coroutines",level:0,uploader:"Kartik Sharma"},B.i,t.M)
B.Me=new A.I(7,{id:1674212018746,question:"Why Coroutines are preferred?",answer:"Coroutines are memory efficient & solves many problems related to concurrency. They simplify the process of writing asynchronous code.\n\n**Elimination of chaining callbacks** : Also refered as \u201cCallback hell\u201d, the infamous practice of nesting callback functions. There are a lot of scenarios wherein callback functions need to be nested. This results in the nesting of callback functions making the code extremely difficult to read and debug. The sequential nature of coroutines precludes the need for using nested callbacks, making the code much more readable and maintainable.\n\n\n**Exception handling and cancellation**\ncan be difficult to manage in a concurrent environment. They make it very easy to handle exceptions. They not only provide methods of propagating and handling exceptions but also allow us to define the cancellation behavior. This feature allows us to write safe concurrent code.\n\n**Sequential Execution** makes concurrent code easy to read and debug\nEach operation within a coroutine executes sequentially. For example, if there is a network call to fetch the details of a product followed by another network call to fetch the image of the product, then, the second request doesn\u2019t execute unless the first request was successfully executed. This has several benefits. First and foremost, it allows us to skip unnecessary network calls. In this example, if a fetch operation to fetch the details of an invalid product is made, then, the fetch operation to get the image of the product can be completely skipped. Secondly, it also makes debugging very easy, since asynchronous code is represented synchronously. Now, this doesn\u2019t mean that it is not possible to execute more than one network call at the same time. The async{} block provided by the coroutines library can be used to achieve concurrent execution.\n\n**Scoped Execution** prevent inefficient use of resources\nAll coroutines must be started in a coroutine scope. If the scope gets canceled, then all coroutines that were started within that scope get canceled. This helps to prevent unnecessary use of resources. Especially in Android, where lifecycles are involved, canceling un-necessary background tasks is of paramount importance. Moreover, in the context of Android development, many jetpack libraries such as room and datastore, provide built-in coroutine scope. This is a big advantage because the users of these libraries do not need to think of when to start and stop the execution of coroutines. We just define what we have to execute and the library will take care of stopping/canceling/restarting the coroutines. This helps to utilize the resources in a very efficient manner.\n",category:"Android",topic:"Coroutines",level:1,uploader:"Kartik Sharma"},B.i,t.M)
B.MC=new A.I(7,{id:1674212221622,question:"What are dispatchers? Explain their types.",answer:"**A dispatcher allows us to specify which pool of threads the coroutines are executed.** The dispatcher can be specified as a part of the coroutine context. There are 5 types of dispatchers that are available for use:\n\n**Default** \u2014 The default dispatcher is used to schedule coroutines that perform CPU-intensive operations such as filtering a large list.\n\n**IO** \u2014 This is the most common dispatcher. It is used to run coroutines that perform I/O operations such as making network requests and fetching data from the local database.\n\n**Main** \u2014 The main dispatcher is used to execute coroutines on the main thread. It generally doesn\u2019t block the main thread, but, if several coroutines containing long-running operations get executed in the context of this dispatcher, then the main thread has a possibility of getting blocked. This is mainly used in conjunction with the withContext(){} method to switch the context of execution to the main thread. This comes in handy if it is required to perform some operation on a background thread and switching the context of execution to the main thread to update the UI. Since touching the UI from a background thread is not permitted in Android, this allows us to switch the context of execution to the main thread before updating the UI.\n\n**Unconfined** \u2014 This dispatcher is very rarely used. Coroutines scheduled to run on this dispatcher run on the thread that they are started/resumed. When they are first called, they get executed in the thread that they are called in. When they resume, they get resumed in the thread that they are resumed in. In summary, they are not confined to any thread pool.\n\n**Immediate**\u2014 The immediate dispatcher is a recently introduced dispatcher. It is used to reduce the cost of re-dispatching the coroutine to the main thread. There is a slight cost associated when switching the dispatcher using the withContext{} block. Using the Immediate dispatcher ensures the following.\n\n- If a coroutine is already executing in the main dispatcher, then the coroutine wouldn\u2019t be re-dispatched, therefore removing the cost associated with switching dispatchers.\n- If there is a queue of coroutines waiting to get executed in the main dispatcher, the immediate dispatcher ensures that the coroutine will be executed as immediately as possible.",category:"Android",topic:"Coroutines",level:1,uploader:"Kartik Sharma"},B.i,t.M)
B.Nu=new A.I(7,{id:1674212282384,question:"What is the importance of a coroutine scope?",answer:"A coroutine scope manages the lifecycle of coroutines that are launched inside the scope. It determines when the coroutines inside the scope get started, stopped, and restarted. Coroutine scopes are especially helpful for the following reasons.\n\n- Allows the grouping of coroutines. If the scope gets canceled, then all coroutines that were started within that scope get canceled. This helps to prevent unnecessary use of resources when the coroutines are no longer needed.\n\n- Coroutine scope helps to define the context in which the coroutines are executed.\n",category:"Android",topic:"Coroutines",level:0,uploader:"Kartik Sharma"},B.i,t.M)
B.LL=new A.I(7,{id:1674212371773,question:"What are suspend functions?",answer:"**A suspending function is simply a function that can be paused and resumed at a later time.** They can execute a long running operation and wait for it to complete without blocking. The syntax of a suspending function is similar to that of a regular function except for the addition of the `suspend` keyword.\n\n    ",category:"Android",topic:"Coroutines",level:0,uploader:"Kartik Sharma"},B.i,t.M)
B.Nc=new A.I(7,{id:1675245568629,question:"What is the difference between Interfaces vs Abstract Class?",answer:"        \n**abstract class**\n- You extend abstract class\n- You can only extend **ONE** abstract class\n- You can have normal methods & properties\n\n**interface**\n- You implement interface\n- You can implement multiple interfaces\n- You can have properties but they will be STATIC & FINAL\n\n\n\n    ",category:"Android",topic:"Java",level:0,uploader:"Kartik Sharma"},B.i,t.M)
B.Mz=new A.I(7,{id:1675245875054,question:"What is the difference between Serializable and Parcelable? Which is preferred?",answer:"**Serializable**\n- It is a standard Java interface. In this approach, you simply mark a class Serializable by implementing the interface and java will automatically serialize it.\n- Reflection is used during the process and many additional objects are created. This leads to plenty of garbage collection and poor performance.\n\n\n**Parcelable**\n- It is an Android-specific interface. In this approach, you implement the serialization yourself.\n- Reflection is not used during this process and hence no garbage is created.\n- Parcelable is far more efficient than Serializable since it gets around some problems with the default Java serialization scheme. Also, it is faster because it is optimized for usage on the development of Android, and shows better results.\n\n\n\n    ",category:"Android",topic:"Java",level:0,uploader:"Kartik Sharma"},B.i,t.M)
B.LV=new A.I(7,{id:1675246220645,question:"Explain about java classes related to the use of sensors on Android.",answer:"Android sensor API provides many classes and interface for the use of sensors on Android. The important classes and interfaces of sensor API are given below:\n\n- **Sensor class:** This class helps you to create an instance of a specific sensor. It provides methods that let you determine a sensor\u2019s capabilities.\n- **SensorManager class:** This class is used to create an instance of the sensor service. It provides methods to access and list sensors, to register and unregister sensor listeners, etc.\n- **SensorEvent class:** This Java class is used to create a sensor event object. It provides information about the sensor event including raw sensor data, the accuracy of data, type of sensor, timestamp of event, etc.\n- **SensorEventListener interface:** This interface is used to create two callback methods that receive sensor event notifications when sensor value changes or when sensor accuracy changes. Those two methods are ``void onAccuracyChanged(Sensor sensor, int accuracy)`` which is called when sensor accuracy is changed and\n``void onSensorChanged(SensorEvent event)`` which is called when sensor values are changed.",category:"Android",topic:"Tools & Concepts",level:1,uploader:"Rohan Patil"},B.i,t.M)
B.Mm=new A.I(7,{id:1675246435403,question:"What is JobScheduler?",answer:"The JobSchedular API is used for scheduling different types of jobs against the framework that will be executed in your app\u2019s own process. This allows your application to perform the given task while being considerate of the device\u2019s battery at the cost of timing control.\n\nThe JobScheduler supports batch scheduling of jobs. The Android system can combine jobs for reducing battery consumption. JobManager automatically handles the network unreliability so it makes handling uploads easier.\n\nHere is some example of the situation where you would use this job scheduler-\n\n- Tasks that should be done when the device is connected to a power supply.\n- Tasks that require a Wi-Fi connection or network access.\n- Tasks that should run on a regular basis as batch where the timing is not critical.",category:"Android",topic:"Services",level:0,uploader:"Rohan Patil"},B.i,t.M)
B.LN=new A.I(7,{id:1675246602985,question:"Difference between Companion object vs Object?",answer:"A\xa0Companion object\xa0is initialized when the class is loaded (typically the first time it's referenced by other code that is being executed) whereas\xa0Object\xa0declarations are initialized lazily, when accessed for the first time.",category:"Android",topic:"Kotlin",level:0,uploader:"Kartik Sharma"},B.i,t.M)
B.MM=new A.I(7,{id:1675246793467,question:"What is @JvmStatic, @JvmOverloads, @JvmField ?",answer:"These are used mainly when we are calling Kotlin code in Java code or vice-versa that is for interoperability.\n\n1. **@JvmStatic** - When you have stuff in ``object{}`` or ``companion object{}`` and now you want to access those in Java you have to do this ClassName.INSTANCE.stuff() or ClassName.Companion.stuff() respectively. To avoid the INSTANCE & Companion, we put \u201c@JvmStatic \u201d so in java we can directly do ClassName.stuff()\n\n2. **@JvmOverload** - When in data class you have some param with default values, so if you use in kotlin, the params are optional. But in Java, it will be required! So if we say while in making ``data class \u2192 data class User @JvmOverloads constructor (\u2026fields)`` so then in Java we can see those fields as optional.\n\n3. **@JvmField** -  To avoid using getter & setters in JAVA provide field in data class with this. [Internally this makes a static field]\n",category:"Android",topic:"Kotlin",level:0,uploader:"Rohan Patil"},B.i,t.M)
B.vN=new A.I(7,{id:1675445098755,question:"What is Testing? Explain types.",answer:'  \n **Testing** \n\nTesting small piece of code in isolation. This helps in maintaining bug-free & modular code when new features are added.\n\n#### - Types\n- **Unit Testing**: Pure Java/Kotlin code test using `JUnit`. If the testcase fails, it means some incremental changes caused this.\n\n```\n\nmain code : Utils-> boolean isPalindrome() \n\ntest code: \n\nclass UtilsTest{\n       lateinit var utils : Utils\n       \n\n       //Runs before every testcase in UtilsTest     \n       @Before\n       fun setUp(){\n          utils = Utils()\n        }\n        \n\n       //Runs after every testcase     \n       @After\n       fun tearDown(){}\n        \n        //TestCase\n        @Test\n         fun isPalindrome_input_racecar_expectedTrue(){\n           val result = utils.isPalindrome("racecar")\n           assertEquals( true,  result )\n                    //(expected, actual)\n        }\n}\n\n```\n\n- **Instrumentation Testing**: Test which are Android specifics, it will require android concepts like context, etc. For exapmple, Reading json file from asset folder\n       \n     1.  **Non-UI**: (Similar to JUnit) It uses android classes like context, assetManager.\n\n     2.  **UI (Espresso)**: Here UI will be mocked and tested, For example clicking on views\n\n\n\n> **Tip:** Testing questions will be mostly around its importance, type & examples.\n',category:"Android",topic:"Testing",level:1,uploader:"Kartik Sharma"},B.i,t.M)
B.vL=new A.I(7,{id:1675447318685,question:"What is a Service in android? Explain types.",answer:"        \n**Services**\n\nIt is an android component that runs on the background to perform long running task.\n\n#### Types -\n- **Background**: It is a service that runs only when the app is running. It is terminated when the app is terminated. You can use **startService()** to start the service.\n\n- **Foreground**: It is a service that stays alive even when the app is terminated. It is mandatory to show a notification to keep running this service in background. You have to use **startForegroundService()**\n\n- **Bound**: A bound service is the server in a client-server interface. It allows components (such as activities) to bind to the service, send requests, receive responses. A bound service typically lives only while it serves another application component and does not run in the background indefinitely.\n\n[Documentation for more details](https://developer.android.com/guide/components/services)\n\n\n\n    ",category:"Android",topic:"Services",level:0,uploader:"Rohan Patil"},B.i,t.M)
B.vM=new A.I(7,{id:1675449145323,question:"MVC vs MVP vs MVVM architecture in Android\n",answer:"Android Architecures are vital for any development of app. It will enable you to properly organize the code, better readability & appropriate for adding new features. SOLID principles should be taken into account while planning the architecture of your project.\n        \n\n- ### MVC\n\n  **Model** - It is business logic and Data State. Getting and manipulating the data, communicates with the controller, interacts with the database, sometimes update the views.\n\n  **View** - What we see. User Interface consists of HTML/CSS/XML. It communicates with the controller and sometimes interacts with the model. It passed some dynamic views through the controller.\n\n  **Controller** - It is Activity/Fragment. It communicates with view and model. It takes the user input from view/REST services. Process request Get data from the model and passes to the view.\n\n  In MVC, the controller is tightly coupled with view. It holds view & data like progress bar, api, etc. This makes it difficult to test the code. It can be used for small projects.\n\n\n- ### MVP\n   **Model** - It is business logic and Data State. Getting and manipulating the data, communicates with the presenter, interacts with the database. It doesn't interact with the view.\n\n   **View** - Consists of UI, activity, and fragment. It interacts with the presenter.\n\n  **Presenter** - It presents the data from the model. Control all the behavior that want to display from the app. It drives the view. It tells view what to do. Any interaction between the model and the view is handled by the presenter. Saves the data back to the model.\n\n  The MVP architecture brings lots of interface & overriding which can make the app complex in large projects. Here, the Presented is tightly coupled with the View.\n  \n\n\n- ### MVVM\n**Model** - This layer has the business logic. It manages the data source, it can be local(RoomDB) or remote souce(api). It passes the data to the ViewModel upon request.\n\n  **View** - It only has the UI code i.e XML views.\n\n   **ViewModel** - It is responsible for bringing the data to UI components. It also facilitates the communication between activites, fragments using data holders like LiveData, etc.\n\n  This architecture solves the tightly coupling issue. The View & View-Model are not tightly coupled. It also uses observable instead of interfaces which simplifies the code logic.    \n\n\n> **Tip**: Prepare for this question: What are SOLID Principles ?",category:"Android",topic:"Architecture",level:0,uploader:"Rohan Patil"},B.i,t.M)
B.MB=new A.I(7,{id:1675245996120,question:"What is the content provider? How it is implemented?",answer:"Content provider is one of the primary building blocks of Android applications, which manages access to a central repository of data. It acts as a standard interface that connects data in one process with code running in another process. So it can be used to share the data between different applications.\n\nThey are responsible for encapsulating the data and providing mechanisms for defining data security. It is implemented as a subclass of ContentProviderclass and must implement a set of APIs that will enable other applications to perform transactions.\n\n```\npublic class MyContentprovider extends ContentProvider {\n\n public void onCreate(){}\n\n}\n```",category:"Android",topic:"Content-Provider",level:0,uploader:"Rohan Patil"},B.i,t.M)
B.M3=new A.I(7,{id:1676702490875,question:"What are SOLID Principles?",answer:'       \nSOLID Principles are mechanism to make your project easy to understand, maintainable. \n\n1. **Single Responsibility Principle -**\n\n   ```\n   One class should have one & only one responsibility\n   ```\nUse layers in your app, break God classes into smaller, meaningful classes.\n\n\n\n2. **Open Closed Principle -**\n\n   ```\n   Software components should be open for extension but closed for modification\n   ```\nExtend & add new features without breaking the existing features and implementations.\n\n3. **Liskov substitution Principle -**\n\n   ```\n   Derieved types must be completely substituable for their base types\n   ```\nBasically, you can always substitute parent with their child. For example - printEmp( object ) is function that prints Employee() object. Now TrainedEmployee() is a child class of Employee(). Henceforth, the printEmp() should work fine even for TrainedEmployee() object.\nObject of subclass should behave same as object of super-class. This principle confirms the "is- a" relationship, aslo it avoids misusing inheritance.\n\n\n4. **Interface segregation Principle -**\n\n   ```\n   Clients should not be forced to implement unecessary methods which they will never use\n   ```\n\n5. **Dependecy inversion Principle -**\n\n   ```\n   Depend on abstraction & not concretion\n   ```\nUsing abstraction makes code easy to maintain,helps to implement well-structured, highly-decoupled, and reusable software components.\n\n\n[Youtube link for a more detailed explanantion](https://youtu.be/oRA-xnqlB10)\n\n\n> **Tip:** Do add your own examples while answering this question\n\n\n    ',category:"Android",topic:"Architecture",level:1,uploader:"Rohan Patil"},B.i,t.M)
